export const Tile = (props) => {
  const arr = Object.values(props.contact)
  return (
      <div className='tile-container'>
          {arr.map((value, index) => {
              return (
                  <div>
                      <p className='tile-title' key={index}>
                          {value}
                      </p>
                  </div>
              );
          })}
      </div>
  );
};
